import styled from "styled-components";
import apple from 'public/assets/AppleLogo.png'

export const Appleimg = styled.img` width: 100%;
height: 100%;`

Appleimg.defaultProps = {
    src: apple,
  };
export const Googleimg = styled.img` width: 100%;
height: 100%;
margin-top: 5%;`
